import "./style/about.css"
function About() {
    return(
        <div>
            <h1>Hi I'm Will a software developer</h1>
            <p>Originally from the UK, I've lived across Japan for six years</p>
            <img src={require('./images/profile.jpg')}alt="profile" className='image'></img>
        </div>
    )
}

export default About
